  return(
    <Container className={s.firstSection}>
      <Grid container colums={2}>
        <Grid item xs={6}>
          <Typography>Real search results only.</Typography>
        </Grid>
        <Grid item xs={6}>

        </Grid>
      </Grid>
    </Container>
  )
}


export default FirstSection;
